import "../Styles/projects.css";

const Projects = () => {
    return (
        <div className='container'>
            <div className='projects'>
                <h2>Projects</h2>
                <div className='projects-flex-item'>
                    <h3>Encryption tool</h3>
                </div>
            </div>
        </div>
    )
}

export default Projects;
